// https://www.youtube.com/watch?v=35lXWvCuM8o&t=497s

import React from "react";
import "./App.css";
import MovieList from "./components/CourseList";
import ButtonSide from "./components/ButtonSide";
import "bootstrap/dist/css/bootstrap.css";

function App() {
  return (
      <div className="App">
        <MovieList />
        <ButtonSide/>
        <div className="modal-header">
        <p>Welcome To Our Site</p>
      </div>
      <div className="modal-content">
        <div className="modal-body">
          <h4>Modal</h4>
          <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Voluptatibus, placeat aliquam? Nostrum vero fugiat rem, itaque molestias ipsa quae facilis.</p>
        </div>
        <div className="modal-footer">
        </div>
      </div>
      </div>
  );
}

export default App;
